// ==UserScript==
// @name         Transgender emoji fix
// @namespace    http://tampermonkey.net/
// @version      0.1
// @description  The transgender flag emoji displays as a white flag followed by the transgender symbol on firefox. This replaces that with an actual proper trans flag emoji.
// @author       BerryBunny
// @match        *://*/*
// @grant        GM_addStyle
// ==/UserScript==

(function() {
    'use strict';

    // Add styles using GM_addStyle to bypass some CSP restrictions
    GM_addStyle(`
        #tampermonkey-visual-indicator {
            position: fixed;
            top: 0;
            left: 0;
            width: 20px;
            height: 20px;
            background-color: red;
            z-index: 9999;
        }
    `);

    function transflagFix() {
        // Replace the emoji with the base64 encoded image
        const base64Image = ""; // Replace with your base64 encoded PNG data

        function processNode(node) {
            if (node.nodeType === 3) { // Text node
                if (node.nodeValue.includes("")) {
                    const newNode = document.createElement('span');
                    newNode.innerHTML = node.nodeValue.split("").join('<img src="data:image/png;base64,' + base64Image + '" alt="" style="width: 1em; height: 1em;" />');
                    node.parentNode.replaceChild(newNode, node);
                }
                if (node.nodeValue.includes("")) {
                    const newNode = document.createElement('span');
                    newNode.innerHTML = node.nodeValue.split("").join('<img src="data:image/png;base64,' + base64Image + '" alt="" style="width: 1em; height: 1em;" />');
                    node.parentNode.replaceChild(newNode, node);
                }
            } else {
                for (let child of node.childNodes) {
                    processNode(child);
                }
            }
        }
        processNode(document.body);
    }

    // Initialize the MutationObserver to run the displayIndicator function whenever the document updates
    const observer = new MutationObserver(transflagFix);
    observer.observe(document.body, { childList: true, subtree: true, characterData: true });

    // Run the displayIndicator function initially
    transflagFix();
})();
